import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from "react-router-dom";
import LandingPage from "./components/LandingPage";
import RegisterPage from "./components/RegisterPage";
import LoginPage from "./components/LoginPage";
import PartTimeJobPage from "./components/PartTimeJobPage";
import JobResultsPage from "./components/JobResultsPage";
import RentPage from "./components/RentPage";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <Router>
      <Routes>
        {/* Landing Page */}
        <Route
          path="/"
          element={<LandingPage isLoggedIn={isLoggedIn} />}
        />

        {/* Register Page */}
        <Route path="/register" element={<RegisterPage />} />

        {/* Login Page */}
        <Route path="/login" element={<LoginPage setIsLoggedIn={setIsLoggedIn} />} />

        {/* Rent Page */}
        <Route
          path="/rent"
          element={isLoggedIn ? <RentPage /> : <Navigate to="/login" />}
        />

        {/* Part-Time Job Page */}
        <Route
          path="/parttime"
          element={isLoggedIn ? <PartTimeJobPage /> : <Navigate to="/login" />}
        />

        {/* Job Results */}
        <Route
          path="/job-results"
          element={isLoggedIn ? <JobResultsPage /> : <Navigate to="/login" />}
        />
      </Routes>
    </Router>
  );
}

export default App;
